import React from "react";
import "./Section.css";

function Section() {
  return (
    <>
      <div className="bgcolor">
        <div className="dashed"></div>
        <h1 className="Text">
          Build <span class="backend-text">Backend</span> task
          <br />
          in one minutes
        </h1>
        <br />
        <div className="container">
          <div className="row">
            <h6 className="lowcode">Low Code</h6>

            <h6 className="visual-backend-builder"> Visual Backend Builder</h6>

            <h6 className="poweres-by-ai">Powerd by AI</h6>
          </div>
        </div>
      </div>
    </>
  );
}
export default Section;
